package Val;

public class Var_change {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		int i = 10;
		int j = 20;
		int result_1 = i*j;
		int result_2 = i/j;
		double result_3 =(double)i/j;
		
		
		System.out.println("결과 1 :"+result_1);
		System.out.println("결과 2 :"+result_3);
	}

}
